  Alkohol:Number,
  Sukker:Number,
  Syre:String,
  Produsent:String,
  Vareurl:String,
  APK:Number,
  Liker: Number,
  Misliker: Number
  },
  { collection : 'inventory' })

// Pagination for only sending a few items at once
ProductSchema.plugin(mongoosePaginate);

//Export schema as mongoose model
module.exports=mongoose.model('inventory',ProductSchema)
